import React from 'react';
import { Form } from 'semantic-ui-react';

export default class CreateVisiteComponent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            visitesList: [{
                enterprise: "Carrefour",
                date: new Date(),
                id: "19920a3dd"
            },
            {
                enterprise: "Leclerc",
                date: new Date(),
                id: "127226rf3"
            },
            {
                enterprise: "Auchan",
                date: new Date(),
                id: "127236rdz2"
            }]
        }
    }
    render() {
        return (
            <Form onSubmit={() => this.props.onSubmit(this.state)}>
                {this.props.forms.map(formItem => {
                    if (Array.isArray(formItem))
                        return (
                            <Form.Group widths="equal">
                                {formItem.map(this.renderForm)}
                            </Form.Group>
                        );
                    else
                        return this.renderForm(formItem);
                }
                )}
                <Form.Button>{this.props.submitButtonText}</Form.Button>
            </Form>);
    }
}
